import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Sum } from './sum'
import { Main } from './main';

class App extends Component {
  constructor() {
    super();
    this.state = {
    }
  }


  render() {
    return (

      <div>

        <Router>
          <Routes>
            <Route path='/sum' element={ <Sum/> } />
            <Route path='/main' element={ <Main/> } />
            </Routes>
        </Router>
      </div>
    );
  }

}

export default App;
